commits.content:
import {
  SearchHistoryPanel,
} from "@/features/SearchHistory/components/SearchHistoryPane";
import type {
  Meta,
  StoryObj,
} from "@storybook/react";

const meta = {
  title: "Features/SearchHistory/components/SearchHistoryPane",
  component: SearchHistoryPanel,
  parameters: {
    layout: "padded",
    backgrounds: {
      default: "white",
      values: [
        {
          name: "white",
          value: "#fff",
        },
        {
          name: "theme",
          value: "#6a44c8",
        },
      ],
    },
  },
} satisfies Meta<typeof SearchHistoryPanel>;

export default meta;

type Story = StoryObj<typeof meta>;

export const Default: Story = {
  args: {},
};
